def getTiposPokemon():
    return ['BUG TYPE|DARK/GRASS/PSYCHIC|FAIRY/FIGHTING/FIRE/FLYING/GHOST/POISON/STEEL|\n', 'DARK TYPE|GHOST/PSYCHIC|DARK/FIGHTING/STEEL|\n', 'DRAGON TYPE|DRAGON|STEEL|FAIRY\n', 'ELECTRIC TYPE|FLYING/WATER|DRAGON/ELECTRIC/GRASS|GROUND\n', 'FAIRY TYPE|DARK/DRAGON/FIGHTING|FIRE/POISON/STEEL|\n', 'FIGHTING TYPE|DARK/ICE/NORMAL/ROCK/STEEL|BUG/FAIRY/FLYING/POISON/PSYCHIC|GHOST\n', 'FIRE TYPE|BUG/GRASS/ICE/STEEL|DRAGON/FIRE/ROCK/WATER|\n', 'FLYING TYPE|BUG/GRASS/FIGHTING|ELECTRIC/ROCK/STEEL|\n', 'GHOST TYPE|GHOST/PSYCHIC|DARK|NORMAL\n', 'GRASS TYPE|GROUND/ROCK/WATER|BUG/DRAGON/FIRE/FLYING/GRASS/POISON/STEEL|\n', 'GROUND TYPE|ELECTRIC/FIRE/POISON/ROCK/STEEL|BUG/GRASS|FLYING\n', 'ICE TYPE|DRAGON/FLYING/GRASS/GROUND|FIRE/ICE/STEEL/WATER|\n', 'NORMAL TYPE||ROCK/STEEL|GHOST\n', 'POISON TYPE|FAIRY/GRASS|GHOST/GROUND/POISON/ROCK|STEEL\n', 'PSYCHIC TYPE|FIGHTING/POISON|PSYCHIC/STEEL|DARK\n', 'ROCK TYPE|BUG/FIRE/FLYING/ICE|FIGHTING/GROUND/STEEL|\n', 'STEEL TYPE|FAIRY/ICE/ROCK|ELECTRIC/FIRE/WATER/STEEL|\n', 'WATER TYPE|FIRE/GROUND/ROCK|DRAGON/GRASS/WATER|\n']


def cargarPokedex(lista =  getPokedex()):
    diccionario = {}
    for linea in lista:
        datos = linea.strip().split('|')
        datos[3] = int(datos[3])
        diccionario[int(datos[0])]=datos[1:]
    return diccionario

def cargarTipos(lista = getTiposPokemon()):
    diccionario = {}
    for linea in lista:
        tipo,doble,mitad,cero = linea.strip().split('|')
        tipo = tipo[:-5]
        diccionario[tipo]=[doble.split('/'),mitad.split('/'),cero.split('/')]
    return diccionario